post.description:
Add an application delivery settings to a community.
Example:
<pre>
 {
 "@class": "IntegrationDeliverySettings",
 "enabled": true,
 "applicationDeliveryId": "999999",
 "deliveryCriteria":
  {
 "@class": "ConjunctorBean",
 "conjunctor": "AND",
 "children":
 [
 {
 "@class": "MetadataCondition",
 "metadataName": "DocumentType",
 "compareOperator": "EQUALS",
 "metadataValue": "ORDERS"
 },
 {
 "@class": "MetadataCondition",
 "metadataName": "UnpackagedBusinessProtocol",
 "compareOperator": "EQUALS",
 "metadataValue": "AS1"
 }
 ]
 }
 }
 </pre>

